import React, { Component } from "react";

export default class CreateExercises extends Component {
  constructor(props) {
    super(props);

    this.state = {
      username: "",
      description: "",
      date: new Date(),
      duration: "",
      users: []
    };
  }

  onChangeUsername(e) {
    this.setState({ username: e.target.value });
  }



  render() {
    return (
      <div>
        <p>Exercises</p>
      </div>
    );
  }
}
